import React, { useState } from 'react'
import { Button, ButtonGroup } from 'react-bootstrap'

const Usestate = () => {
  const [count, setCount] = useState(0)

  return (
    <>
      <h1>Count: {count}</h1>
      <ButtonGroup aria-label="Basic example">
      <Button onClick={() => setCount(count + 1)} variant="secondary">Left</Button>
      <Button onClick={() => setCount(count - 1)} variant="secondary">Right</Button>
    </ButtonGroup>
    </>
  )
}

export default Usestate
